using MelonLoader;
using System;
using System.IO;
using UnityEngine;
using ReMod.Core.Managers;
using uwuclara.Config;

namespace uwuclara.ResourceManager
{
    class Resources
    {
        
        private static string resourcePath = ConfManager.resourcePath;

        internal static Sprite uwuclaraIcon;
        internal static Sprite userHacksIcon;
        internal static Sprite worldHacksIcon;
        internal static Sprite networkHacksIcon;
        internal static Sprite gameHacksIcon;
        internal static Sprite gameMurder4Icon;
        internal static Sprite gameJustBClubIcon;
        internal static Sprite gameAmongASSIcon;
        internal static Sprite sitOnIcon;

        private static Sprite LoadSprite(string sprite)
        {
            return $"{resourcePath}/resources/{sprite}".LoadSpriteFromDisk();
        }

        internal static void InitResources()
        {

            MelonLogger.Msg("Initializing resources...");

            if (!Directory.Exists(resourcePath))
                Directory.CreateDirectory(resourcePath);
            
            if (!Directory.Exists(resourcePath + "/resources"))
                Directory.CreateDirectory(resourcePath + "/resources");

            download();
            LoadResources();
            
        }

        private static void LoadResources()
        {
            uwuclaraIcon = LoadSprite("uwuclara");
            userHacksIcon = LoadSprite("userHacks");
            worldHacksIcon = LoadSprite("worldHacks");
            networkHacksIcon = LoadSprite("networkHacks");
            gameHacksIcon = LoadSprite("gameHacks");
            gameMurder4Icon = LoadSprite("gameMurder4");
            gameJustBClubIcon = LoadSprite("gameJustBClub");
            gameAmongASSIcon = LoadSprite("gameAmongASS");
            sitOnIcon = LoadSprite("sitOn");
        }

        private static void download()
        {

            string uwuclaraImageBase64 = 
                "";

            string userImageBase64 =
                "";
            
            string worldImageBase64 =
                "";
            
            string networkImageBase64 = 
                "";

            string gameImageBase64 =
                "";

            string gameMurder4Base64 =
                "";
            
            string gameJustBClubBase64 =
                "";

            string gameAmongASSBase64 =
                "";
            
            string sitOnBase64 =
                "";
            
            if(!File.Exists(resourcePath + "/resources/uwuclara")) File.WriteAllBytes(resourcePath + "/resources/uwuclara", Convert.FromBase64String(uwuclaraImageBase64));
            if(!File.Exists(resourcePath + "/resources/userHacks")) File.WriteAllBytes(resourcePath + "/resources/userHacks", Convert.FromBase64String(userImageBase64));
            if(!File.Exists(resourcePath + "/resources/worldHacks")) File.WriteAllBytes(resourcePath + "/resources/worldHacks", Convert.FromBase64String(worldImageBase64));
            if(!File.Exists(resourcePath + "/resources/networkHacks")) File.WriteAllBytes(resourcePath + "/resources/networkHacks", Convert.FromBase64String(networkImageBase64));
            if(!File.Exists(resourcePath + "/resources/gameHacks")) File.WriteAllBytes(resourcePath + "/resources/gameHacks", Convert.FromBase64String(gameImageBase64));
            if(!File.Exists(resourcePath + "/resources/gameMurder4")) File.WriteAllBytes(resourcePath + "/resources/gameMurder4", Convert.FromBase64String(gameMurder4Base64));
            if(!File.Exists(resourcePath + "/resources/gameJustBClub")) File.WriteAllBytes(resourcePath + "/resources/gameJustBClub", Convert.FromBase64String(gameJustBClubBase64));
            if(!File.Exists(resourcePath + "/resources/gameAmongASS")) File.WriteAllBytes(resourcePath + "/resources/gameAmongASS", Convert.FromBase64String(gameAmongASSBase64));
            if(!File.Exists(resourcePath + "/resources/sitOn")) File.WriteAllBytes(resourcePath + "/resources/sitOn", Convert.FromBase64String(sitOnBase64));
            
        }
    }
}
